import React from 'react';
import { Card } from 'react-bootstrap';
const Product = (props) => {
   const { product } = props;
   return (
      <Card className='my-1 py-3 rounded'>
         <a href={`/product/${product._id}`}>
            <Card.Img variant='top' src={`${product.image}`} />
         </a>
         <Card.Body>
            <Card.Title></Card.Title>
         </Card.Body>
      </Card>
   );
};

export default Product;
